// IBTokenAllowanceFunc describes the behavior when the Allowance method of
// the parent MockIBToken instance is invoked.
type IBTokenAllowanceFunc struct {
	defaultHook func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error)
	hooks       []func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error)
	history     []IBTokenAllowanceFuncCall
	mutex       sync.Mutex
}

// Allowance delegates to the next hook function in the queue and stores the
// parameter and result values of this invocation.
func (m *MockIBToken) Allowance(v0 *bind.CallOpts, v1 common.Address, v2 common.Address) (*big.Int, error) {
	r0, r1 := m.AllowanceFunc.nextHook()(v0, v1, v2)
	m.AllowanceFunc.appendCall(IBTokenAllowanceFuncCall{v0, v1, v2, r0, r1})
	return r0, r1
}

// SetDefaultHook sets function that is called when the Allowance method of
// the parent MockIBToken instance is invoked and the hook queue is empty.
func (f *IBTokenAllowanceFunc) SetDefaultHook(hook func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error)) {
	f.defaultHook = hook
}

// PushHook adds a function to the end of hook queue. Each invocation of the
// Allowance method of the parent MockIBToken instance invokes the hook at
// the front of the queue and discards it. After the queue is empty, the
// default hook function is invoked for any future action.
func (f *IBTokenAllowanceFunc) PushHook(hook func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error)) {
	f.mutex.Lock()
	f.hooks = append(f.hooks, hook)
	f.mutex.Unlock()
}

// SetDefaultReturn calls SetDefaultHook with a function that returns the
// given values.
func (f *IBTokenAllowanceFunc) SetDefaultReturn(r0 *big.Int, r1 error) {
	f.SetDefaultHook(func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error) {
		return r0, r1
	})
}

// PushReturn calls PushHook with a function that returns the given values.
func (f *IBTokenAllowanceFunc) PushReturn(r0 *big.Int, r1 error) {
	f.PushHook(func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error) {
		return r0, r1
	})
}

func (f *IBTokenAllowanceFunc) nextHook() func(*bind.CallOpts, common.Address, common.Address) (*big.Int, error) {
	f.mutex.Lock()
	defer f.mutex.Unlock()

	if len(f.hooks) == 0 {
		return f.defaultHook
	}

	hook := f.hooks[0]
	f.hooks = f.hooks[1:]
	return hook
}

func (f *IBTokenAllowanceFunc) appendCall(r0 IBTokenAllowanceFuncCall) {
	f.mutex.Lock()
	f.history = append(f.history, r0)
	f.mutex.Unlock()
}

// History returns a sequence of IBTokenAllowanceFuncCall objects describing
// the invocations of this function.
func (f *IBTokenAllowanceFunc) History() []IBTokenAllowanceFuncCall {
	f.mutex.Lock()
	history := make([]IBTokenAllowanceFuncCall, len(f.history))
	copy(history, f.history)
	f.mutex.Unlock()

	return history
}

// IBTokenAllowanceFuncCall is an object that describes an invocation of
